goog.require("axs.AuditRules");goog.require("axs.browserUtils");goog.require("axs.utils");axs.AuditRules.addRule({name:"multipleLabelableElementsPerLabel",heading:"A label element may not have labelable descendants other than its labeled control.",url:"https://github.com/GoogleChrome/accessibility-developer-tools/wiki/Audit-Rules#-ax_text_03--labels-should-only-contain-one-labelable-element",severity:axs.constants.Severity.SEVERE,relevantElementMatcher:function(element){return axs.browserUtils.matchSelector(element,"label")},test:function(scope){var controls=scope.querySelectorAll(axs.utils.LABELABLE_ELEMENTS_SELECTOR);if(1<controls.length)return!0},code:"AX_TEXT_03"});